import './App.css';
import Header from './components/Header';
import Button from './components/button';
import {useNavigate} from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <Header title="Doodly"/>
      <div id="choice">
        <Link to="/canvas"><Button title="New Canvas"/></Link>
        <Button title="Load Canvas"/>
      </div>
    </div>
  );
}

export default App;
